%[text] ## S波超导
%[text] 参考自[一些简单的超导体模型 - 知乎](https://zhuanlan.zhihu.com/p/600284125)
%[text] [s波d波超导体的态密度与谱函数 - 知乎](https://zhuanlan.zhihu.com/p/603315345)
%[text] 哈密顿量为
%[text] $H=-t\\sum\_{\\langle ij\\rangle\\sigma}c\_{i\\sigma}^\\dagger c\_{i\\sigma}+\\sum\_i\\Delta c\_{i\\uparrow}^\\dagger c\_{i\\downarrow}^\\dagger+H.c.-\\sum\_{i\\sigma}\\mu\_i c\_{i\\sigma}^\\dagger c\_{i\\sigma}$
%[text] ### 参数设置
% N_Spin = 2;
clear;
mu = -0.5;
t = 1;
Delta = 0.3;
a = 1;
N_col = 20;
N_row = N_col;
N_site = N_col * N_row;
N_spin = 2;
N_tot = N_site * N_spin;
%[text] ### Nambu基得到BdG哈密顿量
%[text] $\\psi=\\left(\\vec{c}\_\\uparrow,\\vec{c}^\\dagger\_\\downarrow\\right)$
%% Work in Nambu basis \psi = (c_up, cdag_down)T
Hopping = get_Nearest_Square_Hopping_Sparse(N_col, N_row, t, t);
h_chemical_potential = -mu * eye(N_site);
h_offdiagonal = Delta * eye(N_site);
H = [h_chemical_potential + full(Hopping), h_offdiagonal;
    h_offdiagonal, -h_chemical_potential - full(Hopping)];
%%
%[text] 对角化得到能谱并画图
[Wave, Eigen] = eig(H);
[Eigen, perm] = sort(diag(Eigen));
Wave = Wave(:,perm);

figure %[output:62144f8c]
scatter(1:length(Eigen),Eigen,'.') %[output:62144f8c]
xlabel("Number of Eigenvalues"); %[output:62144f8c]
ylabel("$\frac{E}{t}$","Interpreter","latex") %[output:62144f8c]
%[text] 波函数
figure %[output:29346ee0]
Count = 1; %[control:slider:719b]{"position":[9,10]}
plot(Wave(:,Count)) %[output:29346ee0]
title("Wave function") %[output:29346ee0]
%[text] 态密度
figure %[output:73940ff8]
h = histogram(Eigen, N_site/10); %[output:73940ff8]
%%
%[text] 若取x方向为周期性边界条件，哈密顿量变为
%[text] $H=\\sum\_{k\_x,n \\sigma}(-2t\\cos k\_x -\\mu)c\_{k\_x\\sigma,n}^\\dagger c\_{k\_x\\sigma,n}+\\left(\\sum\_{k\_x,n\\sigma} -tc\_{k\_x\\sigma,n}^\\dagger c\_{k\_x\\sigma,n+1}+\\sum\_{k\_x,n}c\_{k\_x,\\uparrow n}^\\dagger c\_{-k\_x,\\downarrow n}^\\dagger + H.c.\\right)$
kx_step = 101;
kx = [-pi,pi];
kx_list = linspace(kx(1), kx(2),kx_step);

energy_band = zeros(N_spin * N_row, kx_step);
for ii = 1: length(kx_list)
    H_diag = (-2 * t * cos(kx_list(ii)) - mu) * eye(N_row)...
            - t * diag(ones(1, N_row-1),1) - t * diag(ones(1, N_row-1),-1);
    H = [H_diag, Delta * eye(N_row);
         Delta * eye(N_row), -H_diag];
    energy_band(:, ii) = eig(H);
end

plot(kx_list, energy_band) %[output:7e8e015a]
%%
%[text] 若取两个方向都为周期性边界条件，哈密顿量变为
%[text] $H=\\sum\_{k\\sigma}\\left\[-2t(\\cos k\_x +\\cos k\_y)-\\mu\\right\]c\_{k\\sigma}^\\dagger c\_{k\\sigma}+\\sum\_{k}\\left(\\Delta c\_{k\\uparrow}^\\dagger c\_{-k\\downarrow}^\\dagger+H.c.\\right)$
k_step = 101;
H = @(kx, ky) [(-2 * t * (cos(kx)+cos(ky)) - mu), Delta;
              Delta, -(-2 * t * (cos(kx)+cos(ky)) - mu)];
energy_band = zeros(3*k_step, N_spin);

% Define high-symmetry points in the Brillouin zone
Gamma = [0, 0]; % Gamma point (0,0)
X = [pi/a, 0];  % X point (pi/a, 0)
M = [pi/a, pi/a]; % M point (pi/a, pi/a)

% Define k-path: Gamma -> X -> M -> Gamma
k_path = [];
% Gamma to X
k1 = linspace(0, 1, k_step);
k_path = [k_path; k1'*X];
% X to M
k2 = linspace(0, 1, k_step);
k_path = [k_path; X + k2'*(M-X)];
% M to Gamma
k3 = linspace(0, 1, k_step);
k_path = [k_path; M + k3'*(Gamma-M)];

for ii = 1:size(k_path,1)
    energy_band(ii, :) = eig(H(k_path(ii, 1), k_path(ii, 2)));
end

% Plot the band structure
figure; %[output:66b203ae]
plot(1:size(k_path,1), energy_band); %[output:66b203ae]
hold on; %[output:66b203ae]

% Mark high-symmetry points
xticks = [1, k_step, 2*k_step, 3*k_step];
xticklabels = {'\Gamma', 'X', 'M', '\Gamma'};
set(gca, 'XTick', xticks, 'XTickLabel', xticklabels); %[output:66b203ae]
xlabel('k-path'); %[output:66b203ae]
ylabel('E'); %[output:66b203ae]
grid on; %[output:66b203ae]
title('s波超导能带') %[output:66b203ae]
% Add vertical lines at high-symmetry points
for i = xticks
    xline(i, 'k--'); %[output:66b203ae]
end
axis([0, 3*k_step, -5, 5]) %[output:66b203ae]

%%
%[text] 态密度
clear

